import { Box, Button, Center, Flex, Heading, Image, Spacer, Text } from "@chakra-ui/react";
import React from "react";

const Home = () => {
  return (
      <Box id="home" p={10}>
         <Box w="90%" h="100%" display="flex" justifyContent="space-evenly" alignItems="center" >
          <Box >
            <Heading>Hey ! I'm Shivam</Heading>
            <Text>Full stack web Developer</Text>
            <Button>CONTACT ME</Button>
            <Button>RESUME</Button>
          </Box>
          <Box >
            <Image
              borderRadius="full"
              boxSize="300px"
              src="https://bit.ly/dan-abramov"
              alt="Dan Abramov"
            />
          </Box>
          </Box>
      </Box>
  );
};

export default Home;
